+@import url("https://fonts.googleapis.com/css2?family=Roboto:wght@400;700&display=swap");
+
+/* Create a wrapper class for applying the font */
+.wrapper {
+	font-family: "Roboto", sans-serif;
+}
+.main_view {
+	background: url("/assets/view.png");
+	background-size: cover;
+	background-repeat: no-repeat;
+	position: relative;
+	background-position: center;
+	height: 70vh;
+	display: grid;
+	align-items: center;
+}
+.main_view::before {
+	content: "";
+	position: absolute;
+	top: 0;
+	left: 0;
+	width: 100%;
+	height: 70vh;
+	background-color: rgba(0, 0, 0, 0.5);
+	z-index: 1;
+}
+
+.main_view > * {
+	position: relative;
+	z-index: 2;
+}
+
+.content {
+	padding: 40px;
+	color: white;
+}
+
+.content h1 {
+	font: 600 50px "Roboto", sans-serif;
+}
+
+.content p {
+	width: 35%;
+	font: 400 20px "Roboto", sans-serif;
+	margin: 30px 0;
+}
+
+.content button {
+	margin-top: 30px;
+	padding: 12px 32px;
+	background-color: #000000;
+	color: white;
+	border: none;
+	border-radius: 5px;
+	font: 400 18px "Roboto", sans-serif;
+	cursor: pointer;
+	transition: 0.3s ease-in-out;
+}
+
+.content button:hover {
+	background-color: #38528a;
+}
+
+@media (max-width: 575px) {
+	.main_view {
+		height: 50vh;
+	}
+
+	.content h1 {
+		font-size: 25px;
+	}
+
+	.content p {
+		width: 100%;
+		font-size: 15px;
+		margin: 30px 0;
+	}
+}
+
+@media (min-width: 768px) and (max-width: 991px) {
+	.main_view {
+		height: 50vh;
+	}
+
+	.content h1 {
+		font-size: 35px;
+	}
+
+	.content p {
+		width: 40%;
+		font: normal 15px "Roboto", sans-serif;
